    animal_patches = image_patch.find("animal")
    # Question assumes only one animal patch
    if len(animal_patches) == 0:
        # If no animal is found, query the image directly
        return image_patch.simple_query("What kind of animal is lying next to the computer mouse?")
    for animal_patch in animal_patches:
        is_next_to_mouse = (animal_patch.simple_query("Is the animal lying next to the computer mouse?") == "yes")
        if is_next_to_mouse:
            return animal_patch.simple_query("What kind of animal is lying next to the computer mouse?") # crop would include the mouse so keep it in the query
    # If no animal is next to the mouse, pick the first animal
    return animal_patches[0].simple_query("What kind of animal is lying next to the computer mouse?")

