def execute_command(image, my_fig, time_wait_between_lines, syntax):
    image_patch = ImagePatch(image)
    cutting_board_patches = image_patch.find("cutting board")
    if len(cutting_board_patches) == 0:
        return image_patch.simple_query("Is the cutting board in the bottom part of the photo?")
    for cutting_board_patch in cutting_board_patches:
        if cutting_board_patch.vertical_center < image_patch.vertical_center:
            return "yes"
